import React, { memo } from 'react';
import Todo from './Todo'
const ToDoList = memo(props => {
    return (
        <section>
            <input className="toggle-all"></input>
            <ul className="todo-list">
                <Todo />
            </ul>
        </section>
    )
})
export default ToDoList;
